$(document).ready(function(){});window.request_signing=(n,t)=>{window.dispatchEvent(new CustomEvent("ICONEX_RELAY_REQUEST",{detail:{type:"REQUEST_SIGNING",payload:{from:n,hash:t}}}))};window.request_has_account=()=>{window.dispatchEvent(new CustomEvent("ICONEX_RELAY_REQUEST",{detail:{type:"REQUEST_HAS_ACCOUNT"}}))};window.request_address=n=>{window.dispatchEvent(new CustomEvent("ICONEX_RELAY_REQUEST",{detail:{type:"REQUEST_ADDRESS"}})),window.addEventListener("ICONEX_RELAY_RESPONSE",t=>{const{type:i,payload:r}=t.detail;i==="RESPONSE_ADDRESS"&&n.invokeMethodAsync("ResponseAddressAsync",r)})};